import styled from "styled-components";
import Wrapper from "../common/Wrapper";
import { Link } from "react-router-dom";
const StyledAuth = styled.div`
  .logo {
    flex: 1;
    font-size: 2rem;
    font-weight: bold;
    align-items: center;
  }
  .logo img {
    width: 50px;
    height: 30.79px;
  }
`;

const AuthForm = () => {
  return (
    <>
      <Wrapper>
        <div className="logo">
          <Link to={"/"}>
            <img src="/icon/WorldTone.png" alt="logo"></img>
          </Link>
        </div>
      </Wrapper>
    </>
  );
};

export default AuthForm;
